DROP TABLE IF EXISTS `PRACTICES`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `PRACTICES` (
  `PRACTICE_ID` int(11) NOT NULL AUTO_INCREMENT,
  `TITLE` varchar(20) NOT NULL,
  `PRACTICE_DESC` varchar(100) NOT NULL,
  `START_DATE` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `TYPE` varchar(100) DEFAULT NULL,
  `VOLUME` varchar(20) DEFAULT NULL,
  `INTENSITY` varchar(20) DEFAULT NULL,
  `DENSITY` varchar(20) DEFAULT NULL,
  `FREQUENCY` varchar(20) DEFAULT NULL,
  `DESCRIPTION` varchar(100) DEFAULT NULL,
  `PLAYER_ID` int(11) DEFAULT NULL,
  `PLAYER_X_POSITION` varchar(100) DEFAULT NULL,
  `PLAYER_Y_POSITION` varchar(100) DEFAULT NULL,
  `PLAYER_Z_POSITION` varchar(100) DEFAULT NULL,
  `TEAM_ID` int(11) NOT NULL,
  `EVENT_ID` int(11) NOT NULL,
  `FIELD_LOCATION` varchar(100) NOT NULL,
  `FIELD_WEIGHT` varchar(100) NOT NULL,
  `FIELD_HEIGHT` varchar(100) NOT NULL,
  `OBJECT_ICON_ID` varchar(50) DEFAULT '',
  `OBJECT_X_POSITION` varchar(100) DEFAULT '',
  `OBJECT_Y_POSITION` varchar(100) DEFAULT '',
  `OBJECT_Z_POSITION` varchar(100) DEFAULT '',
  `CREATION_DATE` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `UPDATE_DATE` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`PRACTICE_ID`),
  KEY `PLAYER_ID` (`PLAYER_ID`),
  KEY `TEAM_ID` (`TEAM_ID`),
  KEY `EVENT_ID` (`EVENT_ID`),
  CONSTRAINT `PRACTICES_ibfk_1` FOREIGN KEY (`PLAYER_ID`) REFERENCES `PLAYER` (`PLAYER_ID`),
  CONSTRAINT `PRACTICES_ibfk_2` FOREIGN KEY (`TEAM_ID`) REFERENCES `TEAM` (`TEAM_ID`),
  CONSTRAINT `PRACTICES_ibfk_3` FOREIGN KEY (`EVENT_ID`) REFERENCES `CALENDAR` (`EVENT_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=133 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

